function alchemicalReduction(array, length) {
  const polymer = [...array];
  for (let i = 0; i < polymer.length; i++) {
    if (polymer[i + 1] === undefined) {
      break;
    }
    if (polymer[i].toUpperCase() === polymer[i + 1].toUpperCase()) {
      const isCurrUpper = polymer[i] === polymer[i].toUpperCase();
      const isNextUpper = polymer[i + 1] === polymer[i + 1].toUpperCase();
      if ((isCurrUpper && !isNextUpper) || (!isCurrUpper && isNextUpper)) {
        polymer.splice(i, 2);
        i - 2 < 0 ? (i = 0) : (i -= 2);
      }
    }
  }
  if (polymer.length === length) return polymer.length;
  return alchemicalReduction(polymer, polymer.length);
}

